import React from "react";
import MyMap from "./components/mymap";
import './App.css'


class App extends Component {

  async loadHelloWorld() {
    const response = await fetch('/hello');   //how it gets backend
    if (response.ok){
      const responseText = await response.text();
      this.setState({ helloMsg: responseText });
    }
    else {
      console.log("Could not connect to backend API.");
    }
  }

  async componentDidMount() {
    const isUserLoggedIn = await fetch('/api/user', {
      method: 'POST'
    }).then(res => res.json()).then(result => this.setUser(result));
  }

  render() {
    return (
      <div>
          <h1 style = {{textAlign: "Center"}}> Covid-19 Hotspot Map</h1>
            <MyMap />
      </div>

    );
  };
}

export default App;
